import React, { Component } from 'react'
import Axios from 'axios'
import Cards from '../components/Cards'

export default class Home extends Component {
    state = {
        data: []
    }




    componentDidMount() {
        Axios.get('http://localhost:8080/post')
            .then(res => {
                this.setState({
                    data: res.data
                })
            })
    }

    render() {

        let { data } = this.state
        return (
            <div>
                
{data.map(datas => (
                    <Cards
                    
                        key={datas._id}
                        headtitle={datas.title}
                        message={datas.body}
                        
                    />
                    ))}
            </div>
        )
    }
}
